import React from 'react'

function About(props) {
    return (
        <div>
      <section id="welcome-section" class="welcome-section">
        <h1>Hey I am Stephen Infanto </h1>
        {props.skills.map((tech)=>{
        <p>A web developer works in { tech } </p>
        })}
     </section>
        </div>
    )
}

export default About
